import React from 'react';

const WTCImage1 = () => {
  const imageUrl = 'https://t4.ftcdn.net/jpg/06/78/51/55/360_F_678515518_mBTG4aFYf8VCVWTL75PVaiMQhigbhhlY.jpg';

  return (
    <div
      style={{
        backgroundImage: `url(${imageUrl})`,
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        backgroundRepeat: 'no-repeat',
        width: '100vw',
        height: '300px',
        position: 'relative',
      }}
    />
  );
};

export default WTCImage1;
